import React from "react";

export default class Stateeg extends React.Component{

    constructor(){
        super()
        this.state={

            data:'JavaScript',
            version:18,
            sub:['evs','math','history']

        }};

        render(){
            return(
                <div>
                    <p style={{color:'brown'}}>{this.state.data}</p>
                    <p style={{color:'blue'}}>{this.state.version}</p>
                    <p style={{color:'violet'}}>{this.state.sub}</p>
                </div>
            )
        
    }
}
